    console.log(game)
    setGames({...games, game})
  }

  return (
    <div className="App">
      <header className="App-header">
        <Form aRegisteredGame={game => aNewGameAdd(game)}/>
        <Time name="Test"/>
      </header>
    </div>
  );
}

